//setup before functions
var typingTimer;                //timer identifier
var doneTypingInterval = 1000;  //time in ms, 5 second for example
var $input = $('#filtro');

//on keyup, start the countdown
$input.on('keyup', function () {
  clearTimeout(typingTimer);
  typingTimer = setTimeout(doneTyping, doneTypingInterval);
});

//on keydown, clear the countdown 
$input.on('keydown', function () {
  clearTimeout(typingTimer);
});

//user is "finished typing," do something
function doneTyping () {
    buscarVaga()
}

function buscarVaga(){
   
    const input = document.getElementById('filtro').value.toUpperCase();
    const cardContainer = document.getElementById('test12')
    console.log(cardContainer)
    const cards = cardContainer.getElementsByClassName('cbtnvaga')

    for (let i = 0; i < cards.length; i++){
        let title = cards[i].querySelector(".card")
        console.log(title)

        if(title.innerText.toUpperCase().indexOf(input) > -1){
            cards[i].style.display = ""
        }else{
            cards[i].style.display = ("none")                    
        }

    }
}